import React, { useState } from "react";
import axios from "axios";

function YieldForm() {
  // Initial state
  const [formData, setFormData] = useState({
    Field_ID: 102,
    Year: 2024,
    Crop: "Maize",
    Previous_Crop: "Wheat",
    Soil_pH: 6.5,
    Soil_Nitrogen: 50,
    Soil_Phosphorus: 20,
    Soil_Potassium: 140,
    Organic_Matter: 3.5,
    Rainfall: 600,
    Avg_Temperature: 25,
    NDVI: 0.65,
    Irrigation: "Drip",
    Fertilizer_Type: "Chemical",
  });

  const [prediction, setPrediction] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState("");

  // Categorical options
  const cropOptions = ["Wheat", "Maize", "Soybean", "Rice", "Barley", "Legume"];
  const irrigationOptions = ["None", "Drip", "Sprinkler"];
  const fertilizerOptions = ["None", "Chemical", "Organic"];

  // Handle input change
  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prev) => ({
      ...prev,
      [name]:
        ["Field_ID","Year","Soil_Nitrogen","Soil_Phosphorus","Soil_Potassium","Rainfall"].includes(name)
          ? parseInt(value)
          : ["Soil_pH","Avg_Temperature","Organic_Matter","NDVI"].includes(name)
          ? parseFloat(value)
          : value,
    }));
  };

  // Handle form submit


const handleSubmit = async (e) => {
  e.preventDefault();

  try {
    const response = await axios.post("http://127.0.0.1:8000/predict", formData);
    const predicted_yield = response.data.predicted_yield;

    const resultData = { ...formData, predicted_yield };

    // Redirect to Result page with prediction data
    navigate("/result", { state: { result: resultData } });
  } catch (error) {
    console.error("Error predicting yield:", error);
    alert("Error occurred while predicting yield!");
  }
};


  return (
    <div style={{ maxWidth: "600px", margin: "50px auto", padding: "20px", border: "1px solid #ddd", borderRadius: "8px" }}>
      <h2>ðŸŒ¾ Crop Yield Prediction</h2>
      <form onSubmit={handleSubmit}>
        {/* Numeric Inputs */}
        {["Field_ID","Year","Soil_pH","Soil_Nitrogen","Soil_Phosphorus","Soil_Potassium","Organic_Matter","Rainfall","Avg_Temperature","NDVI"].map((field) => (
          <div key={field} style={{ marginBottom: "10px" }}>
            <label>{field}: </label>
            <input
              type="number"
              step={["Soil_pH","Organic_Matter","Avg_Temperature","NDVI"].includes(field) ? "0.01" : "1"}
              name={field}
              value={formData[field]}
              onChange={handleChange}
              required
              style={{ width: "100%", padding: "6px" }}
            />
          </div>
        ))}

        {/* Dropdowns */}
        <div style={{ marginBottom: "10px" }}>
          <label>Crop: </label>
          <select name="Crop" value={formData.Crop} onChange={handleChange} style={{ width: "100%", padding: "6px" }}>
            {cropOptions.map((crop) => <option key={crop} value={crop}>{crop}</option>)}
          </select>
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label>Previous Crop: </label>
          <select name="Previous_Crop" value={formData.Previous_Crop} onChange={handleChange} style={{ width: "100%", padding: "6px" }}>
            {cropOptions.map((crop) => <option key={crop} value={crop}>{crop}</option>)}
          </select>
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label>Irrigation: </label>
          <select name="Irrigation" value={formData.Irrigation} onChange={handleChange} style={{ width: "100%", padding: "6px" }}>
            {irrigationOptions.map((opt) => <option key={opt} value={opt}>{opt}</option>)}
          </select>
        </div>

        <div style={{ marginBottom: "10px" }}>
          <label>Fertilizer Type: </label>
          <select name="Fertilizer_Type" value={formData.Fertilizer_Type} onChange={handleChange} style={{ width: "100%", padding: "6px" }}>
            {fertilizerOptions.map((opt) => <option key={opt} value={opt}>{opt}</option>)}
          </select>
        </div>

        <button type="submit" style={{ padding: "10px 20px", marginTop: "10px" }}>Predict Yield</button>
      </form>

      {loading && <p>Loading...</p>}
      {prediction && <h3 style={{ marginTop: "20px" }}>Predicted Yield: {prediction} tons/ha</h3>}
      {error && <p style={{ color: "red" }}>{error}</p>}
    </div>
  );
}


export default YieldForm;
